import React from "react";

function Notes(props){

    function handleDelete(){
        props.deleteNote(props.id);

    }

    return (
        <div className = "note">
        <h1> {props.note_title} </h1>
        <p> {props.note_content} </p>
        <button onClick = {handleDelete}>DELETE</button>
        </div>
    );
}

export default Notes;
